<template>  <el-form-item    :label="currentField.label"    :label-width="currentField.labelWidth + 'px'"  >    <el-time-select      v-model="currentField.entry"      :disabled="currentField.disabled"      :picker-options="{ start: '00:00', step: '00:15', end: '23:45' }"      placeholder="Select time"      @change="currentField.entry = $event"    >    </el-time-select>  </el-form-item></template><script>export default {  name: 'TimePicker',  props: {    currentField: {      type: Object,      default: null,    },  },  data() {    return {      time: '',    };  },};</script>